import './App.css';
import Inicio from './components/inicio';
import accesoAso from './components/accesoAso'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Inicio />} />
        <Route path="/accesoAso" component={accesoAso} />
      </Routes>
    </Router>
  );
}

export default App;
